import { useState, useEffect } from "react";

function App() {
  const [todo, setTodo] = useState("");

  const onChange = (event) => setTodo(event.target.value);
  return (
    <div>
      <input type="text" value={todo} onChange={onChange} placeholder="write your todo ..." />
    </div>
  );
}

export default App;
